#extension GL_OES_standard_derivatives : enable
precision highp float;
precision highp int;



#define iResolution (vec2(width,height))
#define fragCoord (vPosition*iResolution)
#define fragColor (gl_FragColor)
#define iTime time

#define UNIFORM_INSERTION_POINT



varying vec2 vPosition;


//-----------------CONSTANTS MACROS-----------------

#define PI 3.14159265359
#define E 2.7182818284
#define GR 1.61803398875
#define MAX_DIM (max(iResolution.x,iResolution.y))

//-----------------UTILITY MACROS-----------------

#define time ((sin(float(__LINE__))/E/PI+1.0/GR/PI)*time/E/PI/GR)
#define sphereN(uv) (clamp(1.0-length(uv*2.0-1.0), 0.0, 1.0))
#define clip(x) (smoothstep(0.25, .75, x))
#define TIMES_DETAILED (1.0)
#define angle(uv) (atan(uv.y, uv.x))
#define angle_percent(uv) ((angle(uv)/PI+1.0)/2.0)
#define hash(p) (fract(sin(vec2( dot(p,vec2(127.5,313.7)),dot(p,vec2(239.5,185.3))))*43458.3453))

#define flux(x) (vec3(cos(x),cos(4.0*PI/3.0+x),cos(2.0*PI/3.0+x))*.5+.5)
#define rotatePoint(p,n,theta) (p*cos(theta)+cross(n,p)*sin(theta)+n*dot(p,n) *(1.0-cos(theta)))

#define zero(x) (smoothstep(-1.0/PI/E/GR, 1.0/PI/E/GR, sin(x*PI/2.0))*2.0-1.0)
#define absMin(x,y) (abs(x) < abs(y) ? x: y)
#define quadrant(uv) (absMin((zero(uv).x), (zero(uv).y))+floor(uv.x/2.0)+floor(uv.y/2.0))

float saw(float x)
{
    float f = mod(floor(abs(x)), 2.0);
    float m = mod(abs(x), 1.0);
    return f*(1.0-m)+(1.0-f)*m;
}
vec2 saw(vec2 x)
{
    return vec2(saw(x.x), saw(x.y));
}

vec3 saw(vec3 x)
{
    return vec3(saw(x.x), saw(x.y), saw(x.z));
}
vec4 saw(vec4 x)
{
    return vec4(saw(x.x), saw(x.y), saw(x.z), saw(x.w));
}

//-----------------SEEDLINGS-----------------------
float seedling = 0.0;

//-----------------BASE IMAGE--------------------------

vec4 stars(vec2 uv)
{
    float density = 16.0;
    uv *= density;
    float s = floor(uv.x)*1234.1234+floor(uv.y)*123.123+seedling;
    vec2 p = floor(uv)+saw(floor(uv)+iTime+s)*.5+.25;

    float l = length(p-uv);
    float f = smoothstep(.1*GR, 1.0, exp(-l*8.0));

    return vec4(clamp(flux(time+f+s)*f+f*f*f, 0.0, 1.0), f)*saw(time+s);
}

vec4 galaxy(vec2 uv, float iteration)
{
    uv = rotatePoint(vec3(uv, 0.),vec3(0.,0.,1.),time*10.).xy;
    vec2 uv0 = uv;
    float r = length(uv0);
    uv =uv0*(GR+PI)*E;


    float r1 = log(length(uv)+1.)*2.0;
    float r2 = pow(log(length(uv)+1.)*3.0, .5);

    float theta1 = atan(uv.y, uv.x)-r1*PI+seedling+time*50.;
    float theta2 = atan(uv.y, uv.x)-r2*PI+seedling;

    vec4 color = vec4(flux((seedling*GR+1.0/GR)+time), 1.0)+stars(uv0)*E;
    float arm = (acos(1.0-(cos(theta1)*cos(theta1)+sqrt(cos(theta1+PI)*cos(theta1+PI)))/2.0)
                + cos(1.0-(cos(theta2)*cos(theta2)+cos(theta2+PI/2.)*cos(theta2+PI/2.))/2.0));
    arm /= 2.;
    arm *= smoothstep(0., 1., 1.-r);
    vec4 final = arm*color;
    final = (clamp(final, 0.0, 1.0));
    final.a = clamp(arm, 0.0, 1.0);;
    return final;
}

//-----------------IMAGINARY TRANSFORMATIONS-----------------

vec2 cmul(vec2 v1, vec2 v2) {
    return vec2(v1.x * v2.x - v1.y * v2.y, v1.y * v2.x + v1.x * v2.y);
}

vec2 cdiv(vec2 v1, vec2 v2) {
    return vec2(v1.x * v2.x + v1.y * v2.y, v1.y * v2.x - v1.x * v2.y) / dot(v2, v2);
}

vec2 mobius(vec2 uv, float count)
{

    //numerator /= (abs(denominator)+1.0);

    vec2 multa, multb, offa, offb;
    vec2 quotient = vec2(0.0);
    const int bends = 64;
    for(int i = 0; i < bends; i++)
    {

        float iteration = float(i)/float(bends)+1.;

        multa = cos(vec2(time*1.1, time*1.2)+iteration*PI*4.0)*.5+1.0;
        offa = cos(vec2(time*1.3, time*1.4)+iteration*PI*4.0)*2.0;
        multb = cos(vec2(time*1.5, time*1.6)+iteration*PI*4.0)*.5+1.0;
        offb = cos(vec2(time*1.7, time*1.8)+iteration*PI*4.0)*2.0;
        vec2 numerator = uv;
        float radius = (float(i)/float(bends));
      	float turns =sin(time*(count+1.))*PI;
      	vec2 obfuscation = vec2(cos(time+iteration*PI*turns+seedling), 
                                sin(time+iteration*PI*turns+seedling))*radius;
      	vec2 offset = vec2(cos(time), sin(time));
        vec2 denominator =cmul(uv, obfuscation)+offset;
        vec2 final = (cdiv(numerator, denominator));
        quotient += final;
    }
    return quotient/(float(bends));///(GR+sin(time*(count+1.)));
}


void main()
{
    vec2 uv = fragCoord.xy / iResolution.xy;
    float scale = PI*GR*E;
    uv = uv*scale-scale/2.0;

    float aspect = iResolution.x/iResolution.y;

    uv.x *= aspect;

    vec2 uv0 = uv;

    const int max_iterations = 4;

    float antispeckle = 1.0; 
    float magnification = 1.0;

    vec4 color = vec4(0.0);
    float border = 1.0;

    seedling = (floor(uv.x)+floor(uv.y));

    for(int i = 0; i < max_iterations; i++)
    {
        float iteration = float(i)/float(max_iterations)+1.;

        seedling = float(i);
        uv = mobius(uv, float(i)/float(max_iterations));
    seedling += (floor(uv.x)+floor(uv.y))*float(i*i*i+1);

        antispeckle = clamp(1.-length(fwidth(uv))*E, 0.0, 1.0)*clamp(1.-length(color.a)/GR,0.,1.);

        vec3 p = vec3(saw(uv), sphereN(saw(uv*PI)));
        border = min(border, smoothstep(0., 1./PI/GR/E, saw(uv.x*2.)));
        border = min(border,  smoothstep(0., 1./PI/GR/E, saw(uv.y*2.)));
        vec4 g = galaxy((p.xy)*2.0-1.0, iteration);
        color += g*antispeckle * border;//+stars(p.xy)*draw, 0.0, 1.0);

        //uv0 = rotatePoint(vec3(uv0, 0.), vec3(0.,0.,1.), -time*iteration).xy;
    }


    fragColor = clamp(vec4(saw(color.rgb+(1.-border)
                               *flux(time+uv.x+uv.y)), 1.), 0.0, 1.0);
    fragColor.a = 1.;
}

